{"operationName":"GetAutocompleteResults","variables":{"query":"California","queryOptions":{"maxResults":10,"userIdentity":{},"userSearchContext":"FOR_SALE","spellCheck":false},"resultType":["CITIES","NEIGHBORHOODS","ZIPCODES"],"shouldRequestSpellCorrectedMetadata":false},"query":"query GetAutocompleteResults($query: String!, $queryOptions: SearchAssistanceQueryOptions, $resultType: [SearchAssistanceResultType], $shouldRequestSpellCorrectedMetadata: Boolean = false) {
  searchAssistanceResult: zgsAutocompleteRequest(
    query: $query
    queryOptions: $queryOptions
    resultType: $resultType
  ) {
    requestId
    results {
      ...SearchAssistanceResultFields
      ...RegionResultFields
      ...SemanticResultFields
      ...RentalCommunityResultFields
      ...SchoolResultFields
      ...BuilderCommunityResultFields
    }
  }
}

fragment SearchAssistanceResultFields on SearchAssistanceResult {
  __typename
  id
  spellCorrectedMetadata @include(if: $shouldRequestSpellCorrectedMetadata) {
    ...SpellCorrectedFields
  }
}

fragment SpellCorrectedFields on SpellCorrectedMetadata {
  isSpellCorrected
  spellCorrectedQuery
  userQuery
}

fragment RegionResultFields on SearchAssistanceRegionResult {
  regionId
  subType
  state
  county
  city
}

fragment SchoolResultFields on SearchAssistanceSchoolResult {
  id
  schoolDistrictId
  schoolId
}

fragment SemanticResultFields on SearchAssistanceSemanticResult {
  nearMe
  regionIds
  regionTypes
  regionDisplayIds
  queryResolutionStatus
  schoolDistrictIds
  schoolIds
  viewLatitudeDelta
  filters {
    basementStatusType
    baths {
      min
      max
    }
    beds {
      min
      max
    }
    excludeTypes
    hoaFeesPerMonth {
      min
      max
    }
    homeType
    keywords
    listingStatusType
    livingAreaSqft {
      min
      max
    }
    lotSizeSqft {
      min
      max
    }
    parkingSpots {
      min
      max
    }
    price {
      min
      max
    }
    searchRentalFilters {
      monthlyPayment {
        min
        max
      }
      petsAllowed
      rentalAvailabilityDate {
        min
        max
      }
    }
    searchSaleFilters {
      daysOnZillow {
        min
        max
      }
    }
    showOnlyType
    view
    yearBuilt {
      min
      max
    }
  }
}

fragment RentalCommunityResultFields on SearchAssistanceRentalCommunityResult {
  location {
    latitude
    longitude
  }
}

fragment BuilderCommunityResultFields on SearchAssistanceBuilderCommunityResult {
  plid
}
"}

